function replace(e,t,n){e=e.replace(t,"").trim();return e?e+" "+n:n}function YryieSwitch(e,t){var n=document.getElementById("Yryie").getElementsByTagName("table")[0].getElementsByTagName("tr");if(!n)return;var r=n.length,i=0;for(var s=0;s<r;s++){if(n[s].className.indexOf(e)!=-1){n[s].style.display=t?"":"none"}if(!n[s].style.display){if(i++%2){if(n[s].className.indexOf("odd")!=-1){n[s].className=replace(n[s].className,"odd","even")}}else{if(n[s].className.indexOf("even")!=-1){n[s].className=replace(n[s].className,"even","odd")}}}}}
